define(["jquery","lib/dom/trackers/scroll"],function(jquery,scrollTracker){$(".absolute-fixed").each(function(i,el){var $el=$(el);var offset=$el.offset();var minTop=$el.data("min-top");var css={position:"fixed",top:minTop+"px",left:offset.left+"px"};var noCss={position:"",top:"",left:""};var onScroll=function(scrollTop){$el.css(scrollTop>=minTop+offset.top?css:noCss)};if(typeof minTop==="number"&&minTop>0){scrollTracker(onScroll)}})});